j1xYG-qPeTa2iStsQo_vgiFWayKcsUqbFoX3r9x21sfe611SS_5rsuKBEYrLMQU4texodYdNlxHDnCqOBcBwhMK8cBYIOA11dvpb8TGz6SH_jQyFZDwK-xCBQYYW85t0-ejpX5nv2VDXfA-HjZ58cZ_pI0bSTXPVoZMNg5YdgXkfgVoHI0781ooWthFYonAhZTqFZxeYJvPR8JCFmkZrQA4xTQ93sguhnV7nYGkDEv0MRtgrmWg_Rh0MQAGwn6MtU6rWb32MUM1OA\";s:6:\"readme\";O:8:\"stdClass\":12:{s:4:\"name\";s:23:\"Ocean Elementor Widgets\";s:4:\"slug\";s:23:\"ocean-elementor-widgets\";s:4:\"tags\";a:0:{}s:8:\"requires\";s:3:\"5.6\";s:12:\"requires_php\";N;s:6:\"tested\";s:5:\"6.5.3\";s:10:\"stable_tag\";s:5:\"2.4.4\";s:8:\"sections\";O:8:\"stdClass\":4:{s:11:\"description\";s:199:\"<p>Add many new powerful and entirely customizable widgets to the popular free page builder - Elementor.\nThis plugin requires the <a href=\"https://oceanwp.org/\">OceanWP</a> theme to be installed.</p>\";s:12:\"installation\";s:198:\"<ol>\n<li>Upload <code>ocean-elementor-widgets</code> to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate the plugin through the \'Plugins\' menu in WordPress</li>\n<li>Done!</li>\n</ol>\";s:3:\"faq\";s:146:\"<h4>I installed the plugin but it does not work</h4>\n\n<p>This plugin will only work with the <a href=\"https://oceanwp.org/\">OceanWP</a> theme.</p>\";s:9:\"changelog\";s:17035:\"<h4>2.4.4 - MAY 22 2024</h4>\n\n<ul>\n<li>Added: Support for Upgrade Swiper Library option.</li>\n<li>Added: Support for Inline Font Icons option.</li>\n<li>Added: Translations: Portuguese language.</li>\n<li>Updated: Compatibility: WordPress version number.</li>\n<li>Updated: Compatibility: Elementor version numbers.</li>\n<li>Fixed: Widgets: Member: SVG icon color not applied.</li>\n</ul>\n\n<h4>2.4.3 - APR 10 2024</h4>\n\n<ul>\n<li>Fixed: Compatibility: WPML and Polylang: Warning: simplexml_load_file().</li>\n</ul>\n\n<h4>2.4.2 - APR 08 2024</h4>\n\n<ul>\n<li>Updated: WPML translation file.</li>\n<li>Fixed: Woo Slider: Auto-play functionality issue.</li>\n</ul>\n\n<h4>2.4.1 - DEC 11 2023</h4>\n\n<ul>\n<li>NEW: Flash Portfolio widget.</li>\n<li>Updated: Newsletter Form: Correct URL for the settings integration page in widget description.</li>\n<li>Fixed: Login Form Widget: Login is not authenticated over HTTPS protocol.</li>\n</ul>\n\n<h4>2.4.0 - NOV 08 2023</h4>\n\n<ul>\n<li>Added: Blog Carousel: Button alignment control.</li>\n<li>Added: Blog Carousel: Badge option with taxonomy source settings.</li>\n<li>Added: Blog Carousel: Left / Right navigation arrows spacing.</li>\n<li>Added: Blog Carousel: Border control for the item section.</li>\n<li>Added: Blog Carousel: Item Padding control for the Content section.</li>\n<li>Added: Magazine Grid: Clickable Image option.</li>\n<li>Added: Magazine Hero Grid: Custom query option.</li>\n<li>Added: Reset Password: Error handling: displaying error messages above the form.</li>\n<li>Added: Custom Elementor Breakpoints support.</li>\n<li>Updated: Newsletter: Mailchimp API.</li>\n<li>Fixed: Reset Password: Repeated action on incorrect user details.</li>\n</ul>\n\n<h4>2.3.9 - SEP 6 2023</h4>\n\n<ul>\n<li>NEW: Elementor: Page Settings: Columns Grid Frame display to achieve that perfectly aligned design.</li>\n<li>Added: All WooCommerce related widgets: Additional conditional check to avoid potential PHP errors such as: Uncaught Error: Call to a member function woo_function_name() on null.</li>\n<li>Fixed: Testimonials Carousel: Responsive column settings for Tablet device.</li>\n<li>Updated: Compatibility: Elementor and Elementor Pro version numbers.</li>\n</ul>\n\n<h4>2.3.8 - JUL 5 2023</h4>\n\n<ul>\n<li>Updated: Libraries: Axios - 1.4.0.</li>\n<li>Added: Advanced Heading: Responsive margin.</li>\n<li>Added: Woo Products: Responsive columns number.</li>\n<li>Fixed: Advanced Heading: Responsive size alignment.</li>\n<li>Fixed: Pricing Table: Features typography.</li>\n<li>Fixed: Magazine widgets: z-index.</li>\n</ul>\n\n<h4>2.3.7 - MAY 23 2023</h4>\n\n<ul>\n<li>Added: Compatibility: PHP 8.2.6: Creation of dynamic property Ocean_Elementor_Widgets::$plugin_path and Ocean_Elementor_Widgets::$plugin_url is deprecated.</li>\n</ul>\n\n<h4>2.3.6 - MAR 29 2023</h4>\n\n<ul>\n<li>Fixed: News Bar widget: compatibility with Elementor swiper script changes.</li>\n</ul>\n\n<h4>2.3.5 - MAR 15 2023</h4>\n\n<ul>\n<li>Fixed: Blog Grid widget: Uncaught TypeError: Unsupported operand types: int + string in .../ocean-elementor-widgets/modules/blog-grid/widgets/blog-grid.php:667</li>\n</ul>\n\n<h4>2.3.4 - MAR 8 2023</h4>\n\n<ul>\n<li>Added: Magazine Hero widget: Select title tag option.</li>\n<li>Added: Magazine Hero Grid widget: Select title tag option.</li>\n<li>Added: Magazine List widget: Select title tag option.</li>\n<li>Added: Magazine Grid widget: Select title tag option.</li>\n<li>Added: Magazine Grid Simple widget: Select title tag option.</li>\n<li>Improved: Modal widget: Accessibility.</li>\n<li>Improved: Off Canvas widget: Accessibility.</li>\n<li>Improved: Clipboard widget: Accessibility.</li>\n<li>Improved: Switch widget: Accessibility.</li>\n<li>Improved: Ajax Search widget: Accessibility.</li>\n<li>Improved: Carousel / Slider widgets: Functionality with and without Upgrade Swiper Library Elementor experiment.</li>\n</ul>\n\n<h4>2.3.3 - FEB 28 2023</h4>\n\n<ul>\n<li>Added: Prevent Elementor swiper script changes (3.11+ version) influencing carousel and slider scripts.</li>\n<li>Added: Newsletter widget: Accessibility improvements.</li>\n<li>Added: Ocean Elementor Widgets language strings.</li>\n</ul>\n\n<h4>2.3.2 - JAN 24 2023</h4>\n\n<ul>\n<li>Fixed: Newsletter widget: PHP Notice: Undefined Array Key \"hide_button_label_mobile\".</li>\n<li>Fixed: Newsletter widget: PHP Notice: Undefined Index \"hide_button_label\".</li>\n</ul>\n\n<h4>2.3.1 - JAN 10 2023</h4>\n\n<ul>\n<li>Added: Newsletter widget: New settings and styling options for the submit button, including responsiveness options.</li>\n<li>Fixed: Magazine Hero widget: z-index value.</li>\n<li>Fixed: Woo Product widgets: Query control.</li>\n<li>Fixed: Search widgets: Form flashing on click if widgets present on the page.</li>\n</ul>\n\n<h4>2.3.0 - NOV 9 2022</h4>\n\n<ul>\n<li>NEW: Magazine Hero Grid widget.</li>\n<li>NEW: Magazine List widget.</li>\n<li>NEW: Magazine Hero widget.</li>\n<li>NEW: Magazine Grid widget.</li>\n<li>NEW: Magazine Grid Simple widget.</li>\n<li>NEW: Make Elementor column clickable.</li>\n<li>Fixed: Login Form: Redirecting to a 404 page after login.</li>\n<li>Fixed: Blog Grid: Pagination doesn\'t function.</li>\n<li>Fixed: Modal: When timer option is in use the scroll bar disappears.</li>\n<li>Fixed: Woo Slider: Excluding products query doesn\'t function.</li>\n<li>Fixed: Woo Cart Icon: Cart not displayed after product is added to the cart action.</li>\n<li>Fixed: Google reCAPTCHA v3 validation issue.</li>\n</ul>\n\n<h4>2.2.3</h4>\n\n<ul>\n<li>Added: Blog Grid: Offset feature for posts exclusion.</li>\n<li>Added: Blog Carousel: Offset feature for posts exclusion.</li>\n</ul>\n\n<h4>2.2.2</h4>\n\n<ul>\n<li>Fixed: Modal widgets: Modal popup is not opening when using Timer Ppopup and Exit Intent layout.</li>\n</ul>\n\n<h4>2.2.1</h4>\n\n<ul>\n<li>New: Disable / Enable widgets from loading in the Elementor editor.</li>\n<li>Added: OceanWP Theme Panel changes.</li>\n<li>Fixed: Ocean Blog Carousel: Video post format thumbnail: Choose to display the featured image or video for post thumbnail.</li>\n<li>Fixed: Deprecated function _register_controls replaced with register_controls.</li>\n<li>Fixed: Ocean Woo-Slider: Swiper is not defined.</li>\n<li>Removed: Remove non-standard outdated CSS #349</li>\n</ul>\n\n<h4>2.2.0</h4>\n\n<ul>\n<li>NEW: Twitter Embed.</li>\n<li>NEW: Twitter Timeline.</li>\n<li>NEW: Click to Tweet.</li>\n<li>NEW: Fluent Forms support.</li>\n<li>NEW: Formidable Forms support.</li>\n<li>Fixed: Alignment icons not displayed not displayed.</li>\n</ul>\n\n<h4>2.1.1</h4>\n\n<ul>\n<li>Fixed: News Bar Widget: PHP 7.2 parse error.</li>\n</ul>\n\n<h4>2.1.0</h4>\n\n<ul>\n<li>NEW: Coupon widget.</li>\n<li>NEW: Copy to Clipboard widget.</li>\n<li>NEW: Pricing Menu widget.</li>\n<li>NEW: News Bar widget.</li>\n<li>Added: Register Widget: reCaptcha v3 option.</li>\n<li>Added: Countdown Widget: recurring timer option.</li>\n<li>Fixed: Banner Widget: columns number issue.</li>\n<li>Fixed: Divider Widget: icon typography display issue when usage of Elementor fonts enabled in Elementor settings.</li>\n<li>Retired: Caldera Forms Widget: https://calderaforms.com/2021/03/the-future-of-caldera-forms/</li>\n</ul>\n\n<h4>2.0.9</h4>\n\n<ul>\n<li>Fixed: Hotspots widget: display tooltip content.</li>\n</ul>\n\n<h4>2.0.8</h4>\n\n<ul>\n<li>Added: Banner Widget: Option to choose title tag. H5 set as default per previous settings.</li>\n<li>Added: Blog Grid Widget: Option to choose title tag. H2 set as default per previous settings.</li>\n<li>Added: Blog Carousel Widget: Option to choose title tag. H2 set as default per previous settings.</li>\n<li>Fixed: Hotspots widget: removed HTML title attribute to avoid double tooltip display on hover.</li>\n</ul>\n\n<h4>2.0.7</h4>\n\n<ul>\n<li>Fixed: Image Gallery: column numbers issue on responsive.</li>\n<li>Fixed: Pricing Table (new): border radius issue.</li>\n<li>Fixed: Pricing Table (new): features list border color issue.</li>\n<li>Fixed: Pricing Table (new): features list icons color issue.</li>\n<li>Fixed: Pricing Table (new): tooltip position.</li>\n<li>Fixed: Woo Products and Slider: displaying out of stock items on front end even if this option is disabled in WooCommerce settings.</li>\n</ul>\n\n<h4>2.0.6</h4>\n\n<ul>\n<li>Fixed: Scripts: load issue.</li>\n</ul>\n\n<h4>2.0.5</h4>\n\n<ul>\n<li>Fixed: Compatibility: WooCommerce Single Post Gallery: remove console.log from scripts.</li>\n</ul>\n\n<h4>2.0.4</h4>\n\n<ul>\n<li>Fixed: Minor issues.</li>\n</ul>\n\n<h4>2.0.3</h4>\n\n<ul>\n<li>Improved: Fade and Slide transition effects.</li>\n<li>Fixed: Slider: Swiper: bullet and arrow functionality when 2 or more sliders present on the same page.</li>\n<li>Fixed: HotSpots: extra tooltip displayed on longer hover.</li>\n<li>Fixed: Gallery: navigation arrows missing in Lightbox.</li>\n<li>Fixed: Newsletter Form: MailChimp subscription doesn\'t function.</li>\n</ul>\n\n<h4>2.0.2</h4>\n\n<ul>\n<li>Fixed: Search Widget JS Error.</li>\n</ul>\n\n<h4>2.0.1</h4>\n\n<ul>\n<li>Fixed: PHP Parse error: syntax error.</li>\n</ul>\n\n<h4>2.0.0</h4>\n\n<ul>\n<li>Added: Vanila JS.</li>\n</ul>\n\n<h4>1.3.2</h4>\n\n<ul>\n<li>Replaced: Elementor deprecated function _content_template with content_template.</li>\n</ul>\n\n<h4>1.3.1</h4>\n\n<ul>\n<li>Added: OceanWP SVG icon support.</li>\n<li>Fixed: Ajax Search widget: search source option.</li>\n<li>Fixed: Newsletter Widget - MailChimp failed subscription issue.</li>\n</ul>\n\n<h4>1.3.0</h4>\n\n<ul>\n<li>Added: Elementor 3.2.1 typography compatibility.</li>\n<li>Fixed: Sliders responsiveness issues.</li>\n<li>Fixed: Call to Action widget button link issue.</li>\n<li>Fixed: Call to Action widget missing image upon plugin update issue.</li>\n<li>Fixed: Recaptcha Display Fatal Error</li>\n</ul>\n\n<h4>1.2.9</h4>\n\n<ul>\n<li>Fixed: Freemius plugin name issue.</li>\n</ul>\n\n<h4>1.2.8</h4>\n\n<ul>\n<li>Fixed: Search widget icon issue.</li>\n<li>Fixed: Ajax Search widget icon issue.</li>\n</ul>\n\n<h4>1.2.7</h4>\n\n<ul>\n<li>Added: New widget: Testimonial.</li>\n<li>Added: New widget: Testimonial Carousel.</li>\n<li>Added: New widget: Member Carousel.</li>\n<li>Added: New widget: Pricing Table.</li>\n<li>Added: New widget: Instagram.</li>\n<li>Tweak: Call to Action widget completely rewritten.</li>\n<li>Tweak: Blog Carousel widget completely rewritten.</li>\n<li>Tweak: Woo Slider widget updated.</li>\n<li>Tweak: Price List widget improved.</li>\n<li>Fixed: Search icon based on selected Theme Icons from the customizer.</li>\n<li>Fixed: Backend styling on some widgets.</li>\n<li>Fixed: Woo Cart Icon widget in italic.</li>\n</ul>\n\n<h4>1.2.6</h4>\n\n<ul>\n<li>Fixed: Switch Widget issue.</li>\n</ul>\n\n<h4>1.2.5</h4>\n\n<ul>\n<li>Added: Blog Carousel Widget - Meta Icon switch.</li>\n<li>Fixed: Newsletter Widget - MailChimp failed subscription issue.</li>\n</ul>\n\n<h4>1.2.4</h4>\n\n<ul>\n<li>Added: Blog Grid Widget - Meta Icon switch.</li>\n</ul>\n\n<h4>1.2.3</h4>\n\n<ul>\n<li>Fixed: Translation issue - translation not reflected on the front end: subtotal, view cart, checkout.</li>\n<li>Fixed: Video thumbnail in the blog grid widget</li>\n<li>Fixed: Video thumbnail in the blog carousel widget</li>\n</ul>\n\n<h4>1.2.2</h4>\n\n<ul>\n<li>Fixed: Navigation widget issue.</li>\n</ul>\n\n<h4>1.2.1</h4>\n\n<ul>\n<li>Fixed: Link Effect and Button Effect Widget issue.</li>\n<li>Fixed: PHP 7.4 compatibilty.</li>\n</ul>\n\n<h4>1.2.0</h4>\n\n<ul>\n<li>Fixed: Widget icon issue - FA5 Integration.</li>\n<li>Added: New setting - Icon size to control the size of Fontawesome and svg icon</li>\n<li>Fixed: Advanced Heading widget link issue.</li>\n<li>Fixed: OEW Blog Carousel Widget - Meta Font Transform settings issue.</li>\n</ul>\n\n<h4>1.1.9</h4>\n\n<ul>\n<li>Added: Codes for Freemius switch.</li>\n</ul>\n\n<h4>1.1.8</h4>\n\n<ul>\n<li>Fixed: PHP warning message.</li>\n</ul>\n\n<h4>1.1.7</h4>\n\n<ul>\n<li>Fixed: Issue with the latest version of Elementor.</li>\n</ul>\n\n<h4>1.1.6</h4>\n\n<ul>\n<li>Fixed: Issue with the Image Comparaison widget on Firefox.</li>\n<li>Fixed: Issue with the Flip Box widget when an image was selected.</li>\n</ul>\n\n<h4>1.1.5</h4>\n\n<ul>\n<li>Fixed: Issue with the WooCommerce page when you try to edit them with Elementor.</li>\n</ul>\n\n<h4>1.1.4</h4>\n\n<ul>\n<li>Added: New widget, Woo Cart Icon.</li>\n<li>Added: New widget, Search Icon.</li>\n<li>Added: Dynamic field for the Banner Link field widget.</li>\n</ul>\n\n<h4>1.1.3</h4>\n\n<ul>\n<li>Fixed: Translation issue with the Business Hours widget.</li>\n<li>Fixed: WPForms widget was not appearing anymore.</li>\n</ul>\n\n<h4>1.1.2</h4>\n\n<ul>\n<li>Added: Dynamic content for the Image Gallery widget.</li>\n<li>Fixed: Google Map widget issue.</li>\n</ul>\n\n<h4>1.1.1</h4>\n\n<ul>\n<li>Fixed: Small issue with the Circle Progress widget text.</li>\n<li>Fixed: Issue with the title of the Call To Action widget.</li>\n</ul>\n\n<h4>1.1.0</h4>\n\n<ul>\n<li>Added: Accordions widget.</li>\n<li>Added: Advanced Custom Field widget, thanks to Bruno Tritsch for the help.</li>\n<li>Added: Advanced Heading widget.</li>\n<li>Added: Animated Heading widget.</li>\n<li>Added: Banner widget.</li>\n<li>Added: Brands widget.</li>\n<li>Added: Business Hours widget.</li>\n<li>Added: Button Effects widget.</li>\n<li>Added: Buttons widget.</li>\n<li>Added: Call To Action widget.</li>\n<li>Added: Circle Progress widget.</li>\n<li>Added: Countdown widget.</li>\n<li>Added: Divider widget, to add a text or an icon in the divider.</li>\n<li>Added: Flip Box widget.</li>\n<li>Added: Google Maps widget.</li>\n<li>Added: Hotspots widget.</li>\n<li>Added: Image Comparison widget.</li>\n<li>Added: Image Gallery widget.</li>\n<li>Added: Info Box widget.</li>\n<li>Added: Instagram Feed widget.</li>\n<li>Added: Link Effects widget.</li>\n<li>Added: Login widget.</li>\n<li>Added: Lost Password widget.</li>\n<li>Added: Register widget.</li>\n<li>Added: Modal widget.</li>\n<li>Added: Navbar widget.</li>\n<li>Added: Off Canvas widget.</li>\n<li>Added: Price List widget.</li>\n<li>Added: Recipe widget.</li>\n<li>Added: Scroll Up widget.</li>\n<li>Added: Switch widget.</li>\n<li>Added: Table widget.</li>\n<li>Added: Tabs widget.</li>\n<li>Added: Team Members widget.</li>\n<li>Added: Timeline widget.</li>\n<li>Added: Contact Form 7 widget.</li>\n<li>Added: Gravity Forms widget.</li>\n<li>Added: WPForms widget.</li>\n<li>Added: Caldera Forms widget.</li>\n<li>Added: Ninja Forms widget.</li>\n<li>Added: WooCommerce Products widget.</li>\n<li>Added: WooCommerce Categories widget.</li>\n<li>Added: WooCommerce Slider widget.</li>\n<li>Added: Dynamic option added, available if you use Elementor Pro.</li>\n<li>Added: Polish translation, thanks to Fin Fafarafiel.</li>\n<li>Tweak: New setting in the Blog Grid widget to accept custom post type.</li>\n<li>Tweak: Improved settings for the Blog Grid widget.</li>\n<li>Tweak: New setting in the Blog Carousel widget to accept custom post type.</li>\n<li>Tweak: Newsletter Form widget improved, you just need to add your MailChimp API Key and List ID in Theme Panel > Integration, and the form will don\'t redirect anymore.</li>\n</ul>\n\n<h4>1.0.16</h4>\n\n<ul>\n<li>Added: Compatibility with WPML for each widgets.</li>\n</ul>\n\n<h4>1.0.15</h4>\n\n<ul>\n<li>Fixed: Pagination issue with the blog Grid widget when Masonry is used.</li>\n</ul>\n\n<h4>1.0.14</h4>\n\n<ul>\n<li>Deleted: Admin notice if OceanWP is not the theme used.</li>\n</ul>\n\n<h4>1.0.13</h4>\n\n<ul>\n<li>Added: Pagination and Pagination Position fields for the Blog Grid widget.</li>\n</ul>\n\n<h4>1.0.12</h4>\n\n<ul>\n<li>Fixed: Arrows color for the Blog Carousel widget.</li>\n</ul>\n\n<h4>1.0.11</h4>\n\n<ul>\n<li>Tweak: Image size option for the Blog Grid and Blog Carousel widgets.</li>\n</ul>\n\n<h4>1.0.10</h4>\n\n<ul>\n<li>Added: French translation, thanks to Jean of freepixel.net.</li>\n</ul>\n\n<h4>1.0.9</h4>\n\n<ul>\n<li>Tweak: Now, you can add HTML or shortcodes in the Price Table widgets title.</li>\n</ul>\n\n<h4>1.0.8</h4>\n\n<ul>\n<li>Tweak: Better positioning setting for the Logo widget.</li>\n</ul>\n\n<h4>1.0.7</h4>\n\n<ul>\n<li>Added: Logo widget with some fields to use for the custom header style.</li>\n<li>Added: Navigation widget with several styling options to use for the custom header style.</li>\n<li>Added: Ajax Search widget, you will be able to make an ajax search (no page reload).</li>\n<li>Added: Logged In/Out widget, you will be able to display a menu, content or shortcode when a user is logged in or logged out on your site.</li>\n<li>Tweak: Improvement in all widgets classes.</li>\n</ul>\n\n<h4>1.0.6</h4>\n\n<ul>\n<li>Tweak: Scripts loaded only is a widget is used.</li>\n</ul>\n\n<h4>1.0.5</h4>\n\n<ul>\n<li>Added: Control color for the MailChimp widget input.</li>\n<li>Added: Border type for the MailChimp widget input.</li>\n<li>Tweak: Some widgets settings improved.</li>\n</ul>\n\n<h4>1.0.4.2</h4>\n\n<ul>\n<li>Fixed: Issue with StylePress.</li>\n</ul>\n\n<h4>1.0.4.1</h4>\n\n<ul>\n<li>Tweak: JS script, if the carousel or the isotope scripts is disabled, there will be no errors in the console.</li>\n</ul>\n\n<h4>1.0.4</h4>\n\n<ul>\n<li>Tweak: OwlCarousel replaced by Slick script.</li>\n</ul>\n\n<h4>1.0.3</h4>\n\n<ul>\n<li>Fixed: Icons issue.</li>\n<li>Added: Support OceanWP 1.1.</li>\n</ul>\n\n<h4>1.0.2</h4>\n\n<ul>\n<li>Tweak: JS file improved.</li>\n</ul>\n\n<h4>1.0.1</h4>\n\n<ul>\n<li>Added: New tab \"Content\" in Style to the blog carousel widget.</li>\n</ul>\n\n<h4>1.0.0</h4>\n\n<ul>\n<li>Initial release.</li>\n</ul>\";}s:14:\"upgrade_notice\";b:0;s:7:\"banners\";O:8:\"stdClass\":1:{s:3:\"low\";s:67:\"https://s3-us-west-2.amazonaws.com/freemius/plugins/3757/banner.png\";}s:7:\"version\";s:5:\"2.4.4\";s:13:\"download_link\";s:388:\"https://api.freemius.com/v1/installs/14914389/updates/72916.zip?is_premium=true&authorization=FSLA+14914389%3AqyHNacTrPj1xYG-qPeTa2iStsQo_vgiFWayKcsUqbFoX3r9x21sfe611SS_5rsuKBEYrLMQU4texodYdNlxHDnCqOBcBwhMK8cBYIOA11dvpb8TGz6SH_jQyFZDwK-xCBQYYW85t0-ejpX5nv2VDXfA-HjZ58cZ_pI0bSTXPVoZMNg5YdgXkfgVoHI0781ooWthFYonAhZTqFZxeYJvPR8JCFmkZrQA4xTQ93sguhnV7nYGkDEv0MRtgrmWg_Rh0MQAGwn6MtU6rWb32MUM1OA\";}}s:7:\"created\";i:1716548201;s:9:\"timestamp\";i:1716634601;}}',	'no'),
