(11188,	'wpforms_notifications',	'a:4:{s:6:\"update\";i:1652002493;s:4:\"feed\";a:3:{i:0;a:6:{s:5:\"title\";s:24:\"Introducing Form Locator\";s:7:\"content\";s:344:\"WPForms now comes with a feature to conveniently locate your forms. Form locator tracks the number of locations each form is embedded in. It also displays exactly where a form is being used on your site including pages, sidebars, footers, and other widgets. See the announcement on our blog to learn about the exciting changes in WPForms 1.7.4!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:147;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:203:\"https://wpforms.com/introducing-the-new-form-locator-wpforms-1-7-4-is-here/?utm_source=WordPress&utm_medium=liteplugin&utm_campaign=Plugin%20Notification&utm_content=WPForms%201.7.4%20Lite%20Learn%20More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:176:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_medium=liteplugin&utm_campaign=Plugin%20Notification&utm_content=WPForms%201.7.4%20Lite%20Get%20WPForms%20Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2022-05-02 06:59:20\";}i:1;a:6:{s:5:\"title\";s:39:\"Introducing Form Revisions + Form Trash\";s:7:\"content\";s:340:\"WPForms now includes awesome features to help you guard against mistakes and manage your forms more easily. Form revisions make it easy to go back in time and restore a previous version of any form! You can also move forms to the trash instead of permanently deleting them. Read the announcement on our blog to see these features in action!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:142;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:209:\"https://wpforms.com/introducing-wpforms-1-7-3-form-revisions-form-trash-and-more/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin%20Notification&utm_content=WPForms%201.7.3%20Lite%20Learn%20More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:164:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin Notification&utm_content=WPForms 1.7.3 Lite Get WPForms Pro\";s:4:\"text\";s:15:\"Get WPForms Pro\";}}s:5:\"start\";s:19:\"2022-05-02 06:59:20\";}i:2;a:6:{s:5:\"title\";s:30:\"NEW! HubSpot Addon for WPForms\";s:7:\"content\";s:298:\"<span style=\"font-weight: 400;\">Our NEW HubSpot addon makes it easy to send leads from your forms directly to your HubSpot CRM! Send form entries, map custom properties, set contact owners, and more. Upgrade to WPForms Elite and start sending leads from WordPress to HubSpot… the easy way!</span>\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:137;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:181:\"https://wpforms.com/announcing-hubspot-addon-wpforms/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin%20Notification&utm_content=HubSpot%20Addon%20Lite%20Learn%20More\";s:4:\"text\";s:10:\"Learn More\";}s:3:\"alt\";a:2:{s:3:\"url\";s:178:\"https://wpforms.com/wpforms-lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=Plugin%20Notification&utm_content=HubSpot%20Addon%20Lite%20Get%20WPForms%20Elite\";s:4:\"text\";s:17:\"Get WPForms Elite\";}}s:5:\"start\";s:19:\"2022-05-02 06:59:20\";}}s:6:\"events\";a:0:{}s:9:\"dismissed\";a:0:{}}',	'yes'),
